      "https://static.boredpanda.com/blog/wp-content/uploads/2017/05/cute-wholesome-dog-puppy-memes-268-59097e2b67e44__700.jpg",
  },
];

function App() {
  return (
    <div>
      <h1>Work's Change~</h1>
      {WorksImages.map((item) => (
        <WorkSlides
          name={item.workName}
          sculp={item.sculpture}
          text={item.text}
          paint={item.paint}
        />
      ))}
    </div>
  );
}
